import * as React from 'react';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import HomeIcon from '@mui/icons-material/Home';
import SearchIcon from '@mui/icons-material/Search';
import MessageIcon from '@mui/icons-material/Message';
import CompanyName from '../assets/Instagram.png'
import styles from './tabular.module.css'
import { AppBar } from '@mui/material';
import { Box } from '@mui/system';
import { red } from '@mui/material/colors';


const Tabular = () => {
    const handleChange=()=>{}
    const value=""
    return (
        <Box>
              <img className={styles.logo} src={CompanyName} alt="logo" height={1} width={200}/>

        <Tabs orientation='vertical' value={value} onChange={handleChange} aria-label="icon label tabs example" sx={{height:765,width:250,backgroundColor:"black"}} >

          <Tab icon={<HomeIcon sx={{color:"white",margin:1,fontSize:35}} />} iconPosition="start" label="Home" sx={{color:"white",fontWeight:10,padding:0}} />
          <Tab icon={<SearchIcon sx={{color:"white",margin:1,fontSize:35}} />} iconPosition="start" label="Search" sx={{color:"white"}} />
          <Tab icon={<MessageIcon sx={{color:"white",margin:1,fontSize:35}} />} iconPosition="start" label="Message" sx={{color:"white"}} />
        </Tabs>
        </Box    >
      );
    }


export default Tabular
